new Product { Id = 18, Title = "Watermelon", Price = 6.6, Size = "Whole", Details = "Large oval fruit with a thick green skin and a sweet watery pink to red flesh with usually many seeds.nOften the deeper colored the flesh, the sweeter the taste. Watermelon's flesh contains about 6% sugar and it is comprised primarily of water. nnnAll year.nnnWatermelon is best utilized in fresh, uncooked applications. Its flesh can be cubed, balled, sliced into wedges or pureed. The large shell can be carved into a decorative basket and used as a natural vessel for serving beverages or salads. Pureed it can be used to flavor drinks or to make granitas, sorbets and chilled soups. Its sweet flavor pairs well with cucumber, arugula, basil, mint, citrus juice, peanuts, coconut, pecans and robust cheeses such as feta, romano and parmesan. Though not commonly consumed as a result of its bitter flavor the rind of the Watermelon is edible and can be grilled, stewed, stir-fired or pickled. The seeds as well are edible and can be roasted or dried and seasoned. Unlike most other melons, refrigerate Watermelon for best flavor. ", images = 1 },
