new Product { Id = 21, Title = "Iceburg Lettuce", Price = 2.5, Size = "1", Details = "Iceberg Lettuce is round in shape, with packed layers ofncrisp green leaves. The heads are firm and tightly packed with ancentral core or heart. The leaves are crunchy and have a mild flavour.nThe outer leaves are a darker green; the central leaves are pale green.nThe leaves are cupped, hold their shape and can be used to hold fillings.nnAvailabilitynAll year.nnStorenRefrigerate in reusable plastic bags, or store in the crisper.nAvoid squashing the lettuce. Alternatively, if the lettuce roots are stillnattached, stand the lettuce in a jar with the roots in water,nand do not refrigerate.nnWays to eatnLettuce is used raw in salads, sandwiches and rolls.nLettuce leaves may also be used as wraps.nOlder leaves can be used in soups.", images = 1 },
new Product { Id = 22, Title = "Red tipped bananas", Price = 4.9, Size = "1kg", Details = "Red Tip Bananas are great for breakfast and snacking occasions and are the perfect lunchbox addition. nnHow to Pick:nBananas that are yellow and lightly flecked with brown spots will be at their peak flavor. Bananas should be plump, firm, and brightly colored.nnnStore bananas at room temperature, where they will continue to ripen. If you refrigerate your bananas, they will stop ripening, but this will also make the skins go black. The fruit is still okay to eat, but will not be the best quality.nnnAustralian Red Tip Bananas are grown in Far North Queensland, near Innisfail.nnnBananas contain potassium for heathy muscle function, and are high in energy-supprting vitamin B6* nn*Based on one large cavendish banana, or 2 medium lady finger bananas (150g), as part of a healthy balanced diet", images = 1 },
