e the ideal snack to come home to after a long day's work", Ingredients = "IngredientsnPotatoes (64%), Canola Oil, Sunflower Oil, Salt, Antioxidants (Tocopherols, Ascorbic Acid, Rosemary Extract, Citric Acid).", images = 4 },
